import React from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
// import Image from "../public/photoData/15THmodel_01.jpg"

export default function SimpleSlider() {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1
  };
  return (
    <Slider {...settings}>
      <div className="photo1">
        <h3>1</h3>
        <img src="https://thumb.photo-ac.com/58/58c74b017f14c06e491646c97a66eab3_t.jpeg" alt="photo1" />
      </div>
      <div className="photo2">
        <h3>2</h3>
        <img src="/public/photoData/15THmodel_01.jpg" alt="photo2" />
      </div>
      <div className="photo3">
        <h3>3</h3>
      </div>
      <div className="photo4">
        <h3>4</h3>
      </div>
      <div className="photo5">
        <h3>5</h3>
      </div>
    </Slider>
  );
}
